import React from 'react';
import '../../App.css';

export default function Products() {
  return (
    <div className="products">
      <p>Hi, I am Florence!</p>
      <p>
Greetings! I'm Florence, your compassionate AI companion on the path to well-being. Whether you're navigating the complexities of PTSD, have general health inquiries, or seek reliable resources, I'm here to offer guidance and support.

Through our conversations, I can provide informed insights and suggestions, tailored to your unique needs. I can even facilitate appointments with appropriate healthcare professionals, ensuring you receive the expert care you deserve.

Remember, while I strive to be a valuable resource, I am not a substitute for professional medical advice. For diagnosis and treatment plans, consulting a doctor is always crucial.

The beauty of Florence lies in its global accessibility. No matter your location, I am readily available to assist you. So, feel free to confide in me, and together, let's embark on a journey towards a healthier, happier you.</p>
    </div>
  );
}
